import React, { useState, useEffect } from 'react';
import axios from 'axios';

function App() {
  const [data, setData] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get(
          'https://sheets.googleapis.com/v4/spreadsheets/1dgVHy_i0djzz8ncd1L2zOkzI3qy7YSbT7CvV_BPgXm0/values/Sheet1?key=AIzaSyDjQkkzbl0VCCBFMc7sDWliSu6sHAykP3A'
        );
        setData(response.data.values); // Atualiza o estado com os dados da planilha
      } catch (error) {
        console.error('Error fetching data', error);
      }
    };
    
    fetchData();
  }, []);

  return (
    <div className="App">
      <h1>Dados da Planilha</h1>
      {data.length > 0 ? (
        <table>
          <thead>
            <tr>
              <th>Coluna 1</th>
              <th>Coluna 2</th>
              {/* Adicione outras colunas conforme necess√°rio */}
            </tr>
          </thead>
          <tbody>
            {data.map((row, index) => (
              <tr key={index}>
                {row.map((cell, i) => (
                  <td key={i}>{cell}</td>
                ))}
              </tr>
            ))}
          </tbody>
        </table>
      ) : (
        <p>Carregando dados...</p>
      )}
    </div>
  );
}

export default App;
